import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './pages/Home';

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        {/* Placeholder routes for future pages */}
        <Route path="/login/customer" element={<div>Login as Customer (Coming Soon)</div>} />
        <Route path="/login/vendor" element={<div>Login as Vendor (Coming Soon)</div>} />
        <Route path="/register/store" element={<div>Register as Store (Coming Soon)</div>} />
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
